import {Navbar, Container} from "react-bootstrap";

//will be imported in the _app component for all pages
//color: 64AB8A
//needs to be made sticky

const navbar = {backgroundColor: "#64AB8A"}

var icon = (
  <span class="logo">
    <a href="/">
      <img src="../public/images/H4I_green.png" height="33" width="120" alt="text here" /></a>
  </span>
);

class Footer extends React.Component {
  render() {
    return(
      <div className="fixed-bottom">  
      <Navbar style={navbar} brand={icon} toggleNavKey={0}>
          {/* <Container>
            <img src={require("../public/images/H4I_green.png")}/>
          </Container> */}
      </Navbar>
      </div>
  )
  }
}

export default Footer;
